	overflow: hidden;
	border-width: 0px;
	cursor: pointer !important;
	text-indent:-150%;
	margin: 5px 0 0 0;
	display:block;
}

input[type="radio"] {
    border: 0px;
}

.catch_copy,
.item_name {
text-align:left;
}

.commonbig-area h3 {
	text-align:center;
}

.commonbig-area ul {
	width:730px;
	list-style:none;
	margin:0;
	padding:0;
}

.commonbig-area ul li {
	width:240px;
	float:left;
	margin:0 5px 5px 0;;
	padding:0;
}

.commonbig-area ul li.nospace {
	margin-right:0;
}

.center {
